function strikeThrough() {
    let strike = document.querySelector("li");
    strike.style.setProperty("text-decoration", "line-through")

    // OR 
    // strike.style.textDecoration = "line-through"

}
strikeThrough();


function imageSourcer(imageId, imageURL) {

    let img = document.querySelector(imageId);
    img.src = imageURL;
    img.style.height = "300px";
    img.style.width = "300px";
    img.style.margin = "10px";
    
}
imageSourcer("#image-1", "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQNzDCqCU1VMdWYD5x3IlBd5s8AKTlwzSQH5g&usqp=CAU")
imageSourcer("#image-2", "data:image/jpeg;base64,")
imageSourcer("#image-3", "data:image/jpeg;base64,")


function toRemove() {

let removeListItem = document.querySelector("li");
removeListItem.remove();

}

toRemove();
toRemove();

function changeSize(textSize, textId) {

    let newSize = document.getElementById(textId);
    newSize.style.fontSize = textSize;

}

changeSize("50px", "thing-1");
changeSize("10px", "thing-2");

function appendArguments(domElement) {

let unorderedList = document.getElementById('arguments');
unorderedList.appendChild(domElement);

}

let imgDomElement = document.createElement("img");
imgDomElement.src = "data:image/jpeg;base64,"

appendArguments(imgDomElement);

function reSizeImage(imgElement) {

    imgElement.style.height = "30px";

}

reSizeImage(imgDomElement);

function invisibility(imgDomElement) {

    let newClass = document.querySelector(imgDomElement);
    newClass.className = 'invisible';

}

invisibility("h3");

function newListItem(text) {

    let newItem = document.createElement("li");
    newItem.innerText = text;
    return newItem; 
}

let newElement1 = newListItem("hello");
let newElement2 = newListItem("world");

appendArguments(newElement1);
appendArguments(newElement2);

function newHeader(headerSize, someText) {

    let replacementHeader = document.createElement("h" + headerSize);
    replacementHeader.innerText = someText;
    return replacementHeader;

}

let header1 = newHeader("3", "I LOVE SPAGHETTI");
let header2 = newHeader("2", " I ALSO LOVE CANDY");

appendArguments(header1);
appendArguments(header2);